        const AddData = {
            ...InputNewData,
            id: Math.random().toString()
        };
        console.log(AddData);
        props.onSave(AddData);
    };    
    
    return (
        <div>
            <div className="newItem">
                <ChrinkedForm onchange={ToFormHandle}/>
            </div>
        </div>
    )
}

export default SaveNewItem;
